class List extends Component {

    constructor(props) {
        super(props);
        this.state = {
            dat:"Valores muy altos"
        }
    }

    render(){
        return (
            <Card>
              <CardHeader>
                Editar Grupos
              </CardHeader>
              <CardBody>
                <Col xs="12" md="12">
                  hola
                </Col>
              </CardBody>
            </Card>
        );
    }

}

export default(List)
